(27,'AL KAUTSAR SCIENCE COMPETITION XXVI 2022','<p>SMA Kautsar kembali sukses menggelar acara rutin tahunannya bertajuk Al Kautsar Science Competition (ASC) ke XXV pada tanggal 25-26 Januari 2022 dengan tema &ldquo;ASC Melejitkan Talenta Saintis MudaUntuk Indonesia Emas 2045&rdquo;, acara tahunan ini degelar dalam rangkaian MILAD Yayasan Al Kautsar Lampung yang ke 30 pada 16 januari 2022, dimana peserta pada event ini adalah seluruh siswa/I SMP/MTS se Provinsi Lampung.</p>\r\n\r\n<p>Dalam rangkaian kegiatan ASC ini terdapat beberapa cabang perlombaan diantaranya Lomba Olimpiade sains yang terdiri dari 9 bidang olimpiade diantaranya Olimpiade Matematika, Olimpiade Fisika, olimpiade Kimia, Olimpiade Biologi, Olimpiade Komputer/Informatika, Olimpiade Kebumian, Olimpiade Astronomi, Olimpiade Ekonomi dan yang terakhir Olimpiade Geografi, kemudian cabang perlombaan lainnya yaitu Lomba Cepat Tepat (LCT) MIPA, ujar Rr Etty PNW, M.Si sebagai Ketua Pelaksana ASC tahun ini.</p>\r\n\r\n<p>Menurut kepala SMA Al Kautsar H. EkoAnzair,M.Si, ada beberapa hal yang berbeda pada pelaksanaan ASC tahun ini, diantaranya tahun ini ASC sudah dilaksanakan secara full luring atau tatap muka langsung mengingat kondisi pandemi yang sudah semakin membaik, sedangkan pelaksanaan ASC tahun lalu dilakukan secara semi daring (penyisihan online, final offline), kemudian hal berbeda lainnya Jumlah peserta ASC tahun ini meningkat drastis dari peserta tahun lalu dan yang tak kalah menariknya tahun ini sekolah yang meraih Juara Umum akan mendapatkan 2 piala bergilir yaitu piala bergilir Ketua Yayasan Al Kautsar dan Piala Bergilir Gubernur Lampung, Ujarnya.</p>\r\n\r\n<p>Jumlah sekolah yang mengikuti ajang ini sebanyak 32 sekolah yang berasal dari seluruh kabupaten kota di provinsi lampung dengan totaljumlah peserta sebanyak 292 peserta yang terdiri dari 226 peserta untuk lomba olimpiade sains dan 66 tim untuk lomba LCT MIPA. Pelaksanaan lomba dilaksanakan selama 2 hari, penyisihan untuk lomba olimpiade sains dan LCT MIPA dilaksanakan dihari pertama sedangkan Semi Final dan Final dilaksanakan hari ke 2. Setelah dilaksanakan penyisihan dan Final lomba olimpiade sains, didapatlah pemenang pada masing-masing bidang olimpiade sebagai berikut: Olimpiade Matematika Juara 1, 2 dan 3 diraih oleh Juan Luckyanto Chandra (SMP Xaverius 1 Bandar Lampung), Denisya Laiqa Putri (SMPIT Permata Bunda Alawiyah), M. Aziz Al Faruq (SMP Islam Az Zahra), Olimpiade Fisika Juara 1, 2 dan 3 M. Zaidan Riziq Alghazmy (SMP Islam Az Zahra), Alifia Zalfa Naila (SMP Muhammadiyah Ahmad Dahlan Metro), Caitlin Natasha (SMP Xaverius 1 Bandar Lampung). Juara Olimpiade Kimia Juara 1, 2,3 secara berurut diraih oleh Jasmine Syifa Fuada (SMPQ Darul Fattah Bandar Lampung), Fakhri Riziq Syawal (SMPN 1 Bandar Lampung), Nathania Aisyah Salsabila (SMPN 1 Bandar Lampung). Olimpiade Biologi Juara 1, 2, 3 diraih oleh Citra Agil Tri Lestari (MTsN 1 Pringsewu), Happy Eskalahuni Putri Aji (MTsN 1 Pringsewu), Maydeline (SMP Xaverius 1 Bandar Lampung). Olimpiade Komputer Juara 1, 2 dan 3 diraih oleh Farrel Satria Julianto (SMPN 2 Bandar Lampung), Talitha Reva Nabila (MTsN 1 Pringsewu), Muhammad Riffat Dinejad A. (SMPIT Permata Bunda Alawiyah). Olimpiade Astronomi Juara 1, 2 dan 3 secara berurut diraih oleh Abdullah Al-Farizi (SMPN 2 Bandar Lampung), Nidzomah Dina Khoiriyah (MTsN 1 Pringsewu), Zahra Aulia (MTsN 1 Pringsewu dengan). Olimpiade Kebumian Juara 1, 2 dan 3 Adam Marchelliano (MTsN 1 Pringsewu), M. Azka Abdullah (MTsN 2 Bandar Lampung), Alfin Rizky Sentosa (MTsN 1 Pringsewu), Olimpiade Geografi Juara 1, 2 dan 3 diraih oleh Revina Patra (MTsN 1 Pringsewu), Arief Yusril Amali (MTsN 1 Tanggamus), Keyzha Luna Aulia (SMP Muhammadiyah Ahmada Dahlan Metro. Dan yang terakhir Olimpiade Ekonomi Juara 1, 2 dan 3 secara berurutdiraih oleh Nindya Ardelia Sari (SMPN 2 Bandar Lampung), Kyla Adhania Sodrin (MTsN 2 Bandar Lampung), Fitri Nur Azizah (SMPQ Darul Ikhlas).</p>\r\n\r\n<p>Sedangkan Untuk Lomba LCT MIPA, Juara 1 diraih Oleh SMP Xaverius 1 Bandar Lampung, Juara 2 SMPN 14 Bandar Lampung, Juara 3 SMPN 1 Bandar Lampung dan Juara 4 SMPN 2 Bandar Lampung, seluruh pemenang berhak mendapatkan Uang Pembinaan dengan total Rp. 25.000.000, Medali, Trophyuntuk LCT dan sertifikat pemenang, dengan Hasil keseluruhan perlombaan maka yang berhak meraih juara umum Asc ke XXV dan membawa pulang piala bergilir adalah MTsN 1 Pringsewu.</p>\r\n','2022-04-19 10:10:40',6,'Prestasi',48,'87815ed9f13b8ef2effe6c3d0f01f1d6.jpeg',1,'Lukman Adi Candra',0,'al-kautsar-science-competition-xxvi-2022'),
(28,'18 Siswa SMA Al Kautsar Maju ke Olimpiade Sains Tingkat Provinsi','<p>Sebanyak 18 siswa SMA Al Kautsar lolos pada ajang Olimpiade Sains Nasional tingkat kota Bandar Lampung dan maju pada Olimpiade Sains Tingkat Provinsi Lampung (OSN-P). Hal ini berdasarkan kepada Surat Pengumuman Pemenang dari Pusat Prestasi Nasional dan Penetapan Daftar Pemenang OSN Tingkat Kabupaten/Kota (OSN-K) dari Dinas Pendidikan Provinsi Lampung yang disampaikan ke SMA Al Kautsar pada Selasa sore (14/6/2022).</p>\r\n\r\n<p>Guru Pembina OSN SMA AL Kautsar, Guntur mengatakan, ajang OSN-K berlangsung pada 23-25 Mei 2022 lalu. Berdasarkan pengumuman pemenang, siswa SMA Al Kautsar menjadi peserta terbanyak yang berhasil lolos ke OSN Tingkat Provinsi, yakni berjumlah 18 siswa, menyusul dari SMAN 2 Bandar Lampung sebanyak 17 siswa, SMAN 5 Bandar Lampung 9 siswa, MAN 1 Bandar Lampung 9 siswa, selebihnya tersebar di SMA lain, diantaranya SMA Xaverius, SMAN 1 Bandar Lampung, SMA Fransiscus, SMA Quran Darul FAttah, SMAN 9 Bandar Lampung.</p>\r\n\r\n<p>&ldquo;Alhamdulillah ada 18 siswa SMA Al Kautsar yang lolos ke OSN Tingkat Provinsi, dengan delapan siswa meraih medali, yakni tiga medali emas, dua medali perak, dan tiga medali perunggu. Ini menjadi medali terbanyak yang disumbang oleh SMA Al Kautsar di Kota Bandar Lampung,&rdquo; ujar Guntur, Kamis (16//6/2022).</p>\r\n\r\n<p>Ke 18 siswa SMA Al Kautsar yang berhasil lolos ke OSN-P, adalah Fahmi Aziz Firmansyah (Astronomi), &nbsp;Puan Azra Salsabila (Astronomi), &nbsp;Aqiilah Hafizh Randyansyah (Biologi), Yarra Adinda Gunawan &nbsp;(Biologi), Dinda Lathifa Khoirunnisa &nbsp;(Ekonomi), &nbsp;Zahra Anisa Rahman (Ekonomi), &nbsp;Adellia Rizky Putri (Ekonomi), &nbsp;Dimas Dwi Rachmat Susilo (Geografi), &nbsp;Muhammad Ab&#39;Du Al Hafizh (Geografi), &nbsp;Meylin Sabrina &nbsp;(Geografi), M. Rif&#39;At Syauki (Informatika), &nbsp;Ghalib Safaraz Harimurti&nbsp;&nbsp; &nbsp; (Informatika), &nbsp;Muhammad Nabhan Dzaki Aufar (Kebumian), Muhammad &nbsp;Ananda Rahmating Gusti (Kebumian), &nbsp;Khanza Zahran (Kebumian), &nbsp;Muhammad Okto Huzainy (Matematika), &nbsp;Affan Al-Habibie &nbsp;(Matematika), &nbsp;Nadia Andraneta Mursya (Matematika).&nbsp;&nbsp; &nbsp;<br />\r\nAda sembila mata pelajaran yang dillombakan di OSN-K, yakni matematika, fisika, kimia, biologi, informatika, astronomi, kebumian, ekonomi, dan geografi.</p>\r\n\r\n<p>Ditemui terpisah Eko Anzair, M.Si selaku kepala SMA Al Kautsar juga mengaku bersyukur atas hasil yang ditorehkan oleh Tim Olimpiade Sains SMA Al Kautsar. &quot;Kami bersyukur atas hasil OSK tahun ini, ditengah tantangan yang berat untuk anak-anak latihan saat kondisi pandemi tapi para siswa masih bisa bersinergi dengan baik sehingga hasil OSK bisa &nbsp;sesuai harapan kami&quot; Ujar eko</p>\r\n\r\n<p>Berdasarkan data dari Pusat Prestasi Nasional, OSN-K &nbsp;&nbsp; &nbsp;diikuti oleh 230.562 siswa se Indonesia untuk sembilan bidang pelajaran yang dilombakan. Plt. Pusat Prestasi Nasional, Asep Sukmayadi menegaskan daftar pemenang OSN-K ini ditetapkan oleh Dinas Pendidikan Provinsi berdasarkan hasil penilaian dewan juri.</p>\r\n','2022-06-17 07:43:12',6,'Prestasi',46,'fb74a50e26167b4519074d01e0aec318.jpg',1,'Lukman Adi Candra',0,'18-siswa-sma-al-kautsar-maju-ke-olimpiade-sains-tingkat-provinsi'),
(29,'Gubernur Arinal Melakukan Peletakan Batu Pertama Pembangunan Al Kautsar Indoor Sport Center','<p>BANDARLAMPUNG &ndash; Gubernur Lampung Arinal Djunaidi didampingi Ketua Yayasan Al Kautsar Wagiso dan Pembina Yayasan Al Kautsar Mawardi AS melakukan Peletakkan Batu Pertama pembangunan Al Kautsar Indoor Sport Center, di Kampus 1 Yayasan Al Kautsar, Bandar Lampung, Jumat (26/08/2022).</p>\r\n\r\n<p>Gubernur Arinal mengatakan bahwa sebagaimana diketahui bersama, Al Kautsar lahir dari cita-cita masyarakat Islam di Provinsi Lampung dengan dukungan penuh dari Pemerintah Tingkat I Provinsi Lampung di masa itu untuk menghadirkan sekolah umum bernafaskan Islam di Bumi Ruwa Jurai tercinta ini, sehingga lahirlah TK, SD, SMP, dan SMA Al Kautsar seperti yang ada sekarang ini.</p>\r\n\r\n<p>&ldquo;Keunggulan Al Kautsar kita akui hingga saat ini, utamanya SMA Al Kautsar yang terus menorehkan prestasi baik di tingkat Provinsi maupun nasional, termasuk siswa lulusannya banyak yang berhasil masuk ke Perguruan Tinggi Negeri favorit di seluruh Indonesia dan mancanegara,&rdquo; ucap Gubernur.</p>\r\n\r\n<p>&ldquo;Hari ini, kita akan menjadi saksi bahwa Yayasan Al Kautsar tidak ingin hanya unggul dibidang prestasi akademik maupun pendidikan agamanya, tetapi juga ingin unggul dibidang prestasi olah raga siswa-siswinya dengan pembangunan Gedung Al Kautsar Indoor Sport Center ini,&rdquo; ungkapnya</p>\r\n\r\n<p>Dengan tersedianya sarana dan fasilitas olahraga yang baik, Gubernur berharap dapat memunculkan olahragawan/olahragawati atau atlet-atlet baru dari kalangan pelajar yang nantinya akan dapat mengharumkan nama Provinsi Lampung di tingkat nasional.</p>\r\n\r\n<p>&ldquo;Semoga nanti, tidak hanya siswa yang pandai dalam bidang akademik saja yang bisa masuk ke Al Kautsar, siswa-siswi yang punya bakat dalam bidang olahraga dan juga seni juga harus difasilitasi untuk bisa masuk di Al Kautsar,&rdquo; pungkas Gubernur</p>\r\n\r\n<p>Sementara itu, Ketua Yayasan Al Kautsar, Wagiso dalam laporannya menyampaikan bahwa sekolah Al Kautsar telah menorehkan berbagai prestasi dibidang akademik, baik ditingkat Provinsi maupun Nasional.</p>\r\n\r\n<p>Kemudian dengan dibangunnya Indoor Sport Center ini, Wagiso berharap akan muncul prestasi baru yang bukan hanya dari sisi akademik, tapi juga dibidang oleh raga dan seni.</p>\r\n\r\n<p>&ldquo;Pencapaian berbagai prestasi yang kami peroleh tentu tidak lepas dari dukungan dari Pemerintah Daerah dan dinas terkait, baik Dinas Pendidikan Pemerintah Provinsi maupun Pemerintah Kota,&rdquo; ucap Wagiso</p>\r\n\r\n<p>&ldquo;Kemudian untuk melengkapi sarana dan prasaran pendidikan yang baik, kami juga akan membangun Indoor Sport Center agar dapat digunakan setiap saat tanpa terganggu cuaca,&rdquo; tutunya.</p>\r\n\r\n<p>Al Kautsar Indoor Sport Center akan dibangun dengan bentang luar bangunan 60x45m dengan luas total bangunan 3774 meter persegi.</p>\r\n\r\n<p>Adapun, Lantai satu terdiri dari lapangan utama dengan luas 33x33m dengan beberapa ruang pendukung disekelilingnya, dan Lantai dua terdiri dari tribun bagian belakang, kanan, dan kiri, dengan daya tampung mencapai 2000 hingga 2500 orang</p>\r\n\r\n<p>&ldquo;Al Kautsar Indoor Sport Center ini pak Gubernur, kami bangun dengan standar Nasional, sehingga nanti bisa digunakan sebagai venue untuk even-even nasional maupun daerah,&rdquo; pungkas Wagiso. (Dinas Kominfotik Provinsi Lampung).</p>\r\n','2022-09-12 07:28:45',13,'Olah Raga',40,'92ecdeffa49c53a368e17e9f7929737d.jpg',1,'Lukman Adi Candra',0,'gubernur-arinal-melakukan-peletakan-batu-pertama-pembangunan-al-kautsar-indoor-sport-center'),
(30,'SMA Al Kautsar Sekolah Terbaik di Lampung Versi LTMPT','<p>PORTALLNEWS.ID (Bandar Lampung) &ndash; SMA Al Kautsar menjadi sekolah terbaik di Provinsi Lampung berdasarkan perangkingan oleh Lembaga Tes Masuk Perguruan Tinggi (LTMPT).</p>\r\n\r\n<p>Lembaga ini merilis Top 1.000 sekolah tahun 2022 berdasakan nilai Ujian Tertulis Berbasis Komputer (UTBK) SBMPTN tahun 2022. Pengumuman Top 1.000 sekolah di Indonesia ini dapat diakses di situs&nbsp;<em>ltmpt.ac.id.</em></p>\r\n\r\n<p>Secara nasional, SMA Al Kautsar berada di rangking 226, dan di peringkat ke-1 Provinsi Lampung dengan total nilai 557,135.</p>\r\n\r\n<p>Selanjutnya, SMA Xaverius diposisi 231 nasional dan peringkat ke-2 Provinsi Lampung dengan total 556,262. Diikuti oleh SMAN 2 Bandar Lampung di posisi 658 nasional dan peringkat ke-3 Provinsi Lampung dengan total nilai 525,347.</p>\r\n\r\n<p>Lalu, SMAN 1 Metro diposisi 666 nasional dan peringkat ke-4 Provinsi Lampung dengan total nilai 524,930, serta SMAN 9 Bandar Lampung diposisi 953 nasional dan peringkat ke-5 Provinsi Lampung dengan total nilai 514,516.</p>\r\n\r\n<p>Kepala SMA Al Kautsar, Eko Anzair mengatakan pengumuman Top 1.000 Sekolah Tahun 2022 dirilis LTMPT pada Jumat sore (26/8/2022). Eko bersyukur, posisi SMA Al Kautsar naik secara nasional yakni dari 323 pada 2021 melompat ke 226 pada tahun 2022 ini.</p>\r\n\r\n<p>&ldquo;Alhamdulillah, di usia 30 tahun Yayasan Al Kautsar, SMA Al Kautsar bisa meraih peringkat nomor 1 di Provinsi Lampung. Prestasi ini berkat kerjasama seluruh dewan guru, staf karyawan dalam membimbing dan memotivasi siswa selama menempuh pendidikan di Al Kautsar. Semua prestasi ini juga tidak luput dari dukungan yayasan Al Kautsar dan para orangtua siswa,&rdquo; kata Eko, Sabtu (27/8/2022).</p>\r\n\r\n<p>Eko berharap, SMA Al Kautsar dapat mempertahankan prestasi dengan menjadi peringkat 1 di Provinsi Lampung dan terus meningkatkan posisi di peringkat nasional.</p>\r\n','2022-09-12 07:30:32',6,'Prestasi',39,'20af1e178fd3cdef03566c12aa9c81f0.jpg',1,'Lukman Adi Candra',0,'sma-al-kautsar-sekolah-terbaik-di-lampung-versi-ltmpt');
